import React, { Component } from "react";

import "../assets/scss/landing.scss";

export default class Landing extends React.Component {
  state = {};
  componentDidMount() {}

  render() {
    return (
      <div className="uniu-logo">
        <img src="../assets/img/app-icon-rounded.png"></img>
      </div>
    );
  }
}
